import React from 'react';

function Pokedex(props) {
  return (
    <div>
      {props.pokemonList.map((value, index) => {
        return (<Pokemon name={value.name} image={value.image} type={value.type} />);
      })}
    </div>
  );
}

function Pokemon(props) {
  return (
    <div class="col-4 bg-light border rounded" >
      <h4>{props.name}</h4>
      <img src={props.image}/>
      <h6>Type: {props.type}</h6>
    </div>
  );
}

export default Pokedex;
